INSERT INTO `dataset_head` VALUES (1,'Enrollment','Physical Table [enrolment_bosy]',1,'2017-10-02 07:49:56','SYSTEM',NULL,NULL,1,NULL,1,2),(2,'School Profile','Physical Table [school_profile_history]',1,'2014-10-07 04:20:32','SYSTEM',NULL,NULL,1,NULL,2,1),(3,'Total Enrolment','The total number of learners enrolled in the school ',0,'2014-12-09 06:33:54','SYSTEM',NULL,NULL,1,1,1,5),(4,'Monograde Enrolment \r\n','Learners being taught in classes consisting of a single grade only.',0,'2014-12-09 06:34:01','SYSTEM',NULL,NULL,1,1,1,6),(5,'Multigrade Enrolment\r\n','Learners being taught in classes consisting of two or more grades handled by one teacher.',0,'2014-12-09 06:34:05','SYSTEM',NULL,NULL,1,1,1,7),(6,'Number of Balik-Aral\r\n','Learners who finished a grade level, stopped schooling and enrolled in the next grade level after a year or more.',0,'2014-12-09 06:34:09','SYSTEM',NULL,NULL,1,1,1,8),(7,'CCT/4Ps Recipients\r\n','Learners whose families are included in the Conditional Cash Transfer (CCT) under the Pantawid  Pamilyang Pilipino Program (4Ps) of  the Department of  Social Welfare and Development (DSWD). ',0,'2014-12-09 06:34:22','SYSTEM',NULL,NULL,1,1,1,9),(8,'School Basic Info','School Basic Information',0,'2014-12-09 06:33:10','SYSTEM',NULL,NULL,1,2,2,2),(16,'Enrollment School Profile','Enrollment School Profile',0,'2018-02-22 09:12:39','SYSTEM',NULL,NULL,0,0,1,4),(50,'Indigenous Peoples\' Learners ','refers to learners born of either or both parents who are IPs as defined by the Indigenous Peoples Republic Act 1997. (e.g. Ivatan, B\'laan, Ibaloy, Mangyan, Aeta, etc.)',0,'2014-12-09 06:34:29','SYSTEM',NULL,NULL,1,1,1,11),(51,'Learners in Alternative Delivery Mode (ADM) ','refers to learners who are enrolled in Alternative Delivery Mode (i.e., an alternative modalities of education delivery within the formal system that allow schools to deliver quality education to marginalized students and those at risk of dropping out by helping them overcome personal, social, and economic constraints in schooling).',0,'2014-12-09 06:36:04','SYSTEM',NULL,NULL,1,1,1,12),(52,'Learners in Arabic Language and Islamic Values Education (ALIVE) Classes','refers to learners enrolled in ALIVE (i.e., a program with the aim of preserving Arabic language and Muslim culture through its inclusion in the regular basic education curriculum) ',0,'2014-12-09 06:36:49','SYSTEM',NULL,NULL,1,1,1,19),(53,'Muslim Learners','refers to learners who are born of either or both parents practicing the Islam religion or faith.',0,'2014-12-09 06:37:25','SYSTEM',NULL,NULL,1,1,1,21),(54,'Number of Repeaters ','refers to learners who failed or left a particular grade level in any previous school year and are enrolled in the same grade level where they left or failed.',0,'2014-12-09 06:37:55','SYSTEM',NULL,NULL,1,1,1,25),(55,'Number of Learners Previously Enrolled in Other School','refers to pupils who were enrolled in another public or private school from the previous school year, as of the given cutt-off date',0,'2014-12-09 06:37:46','SYSTEM',NULL,NULL,1,1,1,22),(56,'Number of Learners Previously Enrolled in Other Public School','refers to pupils who were enrolled in another public school from the previous school year, as of the given cutt-off date',0,'2014-12-09 06:37:48','SYSTEM',NULL,NULL,1,1,1,23),(57,'Number of Learners Previously Enrolled in Private','refers to pupils who were enrolled in private school the previous school year, as of the given cutt-off date',0,'2014-12-09 06:37:50','SYSTEM',NULL,NULL,1,1,1,24),(58,'End-of-School Year Enrollment ','refers to the total number of learners enrolled in the school as of last day of the previous school year.',0,'2014-12-09 08:10:38','SYSTEM',NULL,NULL,1,1,1,76),(59,'Number of Graduates','Graduates refers to the number of learners in grade 6 in elementary, grade 10 in junior high school and grade 12 in senior high school who completed the grade level.',0,'2014-12-09 08:10:40','SYSTEM',NULL,NULL,1,1,1,77),(60,'Number of Completers/Promotees','Completers refers to the number of learners who have completed the requirements for Kindergarten.  \nPromotees refers to the number of learners in grades 1 to 5, in elementary, grades 7 to 9 in junior high school and grade 11 in senior high school who successfully completed the grade level. ',0,'2014-12-09 08:10:44','SYSTEM',NULL,NULL,1,1,1,78),(61,'Number of Dropouts','refers to learners who left school before completing the prescribed grade level within the specified school year after the cut- off date onwards and  should not be included in the total enrolment as of the last day of the previous school year',0,'2014-12-09 08:10:47','SYSTEM',NULL,NULL,1,1,1,79),(62,'Number of Transferees-In','refers to learners who entered the school from another school, either government or private after the cut- off date onwards and  should be included in the total enrolment as of the last day of the previous school ',0,'2014-12-09 08:10:50','SYSTEM',NULL,NULL,1,1,1,80),(63,'Number of Transferees Out','refers to learners who left school to enter another school as evidence by the request for permanent record (Form 137) after the cut- off date onwards and should not be included in the total enrolment as of the last day of the previous school year',0,'2014-12-09 08:10:52','SYSTEM',NULL,NULL,1,1,1,81),(64,'Number of Late Enrollees',' refers to learners who entered the school after the cut-off date onwards and  should be included in the total enrolment as of the last day of the previous school year',0,'2014-12-09 08:10:56','SYSTEM',NULL,NULL,1,1,1,82),(65,'Number of Continuing Learners','refers to learners enrolled in ADM in secondary schools who have not yet completed the modules for the grade level and should be included in the total enrolment of the previous school year',0,'2014-12-09 08:10:59','SYSTEM',NULL,NULL,1,1,1,83),(67,'Learner in Alternative Delivery Modes','Learner who is enrolled in Alternative Delivery Modes (i.e., alternative modalities of education delivery within the formal system that allow schools to deliver quality education to marginalized students and those at risk of dropping out by helping them overcome personal, social, and economic constraints in schooling)',0,'2014-12-09 06:36:11','SYSTEM',NULL,NULL,1,NULL,1,13),(68,'Distance Education (DistEd) for SPED','ADM which addresses the accessibility problem of learners with disabilities ages 6-19. Due to the distance between the school and their homes the families of these learners cannot access to the special education program in the regular school. Likewise, these learners belong to the families with low socio-economic status and their parents cannot afford the expenses that go with their education',0,'2014-12-09 06:36:14','SYSTEM',NULL,NULL,1,67,1,14),(69,'Enhanced Instructional Management by Parents, Community and Teachers (e-IMPACT)','Intervention infused with technology and aligned with the Revised Basic Education Curriculum (RBEC) of the Department of Education. This approach utilizes the services of parents, community members including the learners themselves in managing teaching and learning.',0,'2014-12-09 06:36:19','SYSTEM',NULL,NULL,1,67,1,15),(70,'Modified In-School Off-School Approach (MISOSA)','ADM which serves children under difficult circumstances through community partnership.',0,'2014-12-09 06:36:21','SYSTEM',NULL,NULL,1,67,1,16),(71,'Other School-Initiated Interventions','Innovative and homegrown interventions developed by schools to prevent the Student-At-Risk-of-Dropping-Out (SARDOs) from dropping out and to increase their achievement rate.',0,'2014-12-09 06:36:25','SYSTEM',NULL,NULL,1,67,1,17),(72,'Open High School Program (OHSP)','Alternative mode of secondary education that addresses learning problems of Student-At Risk-of-Dropping-Out (SARDOs) who cannot join the regular class program due to justifiable reasons. These reasons may include physical impairment, employment, distance of home to school, education design, family problems and the like.',0,'2014-12-09 06:36:28','SYSTEM',NULL,NULL,1,67,1,18),(119,'SPED Graded','SPED Graded',0,'2014-12-09 06:38:05','SYSTEM',NULL,NULL,1,1,1,26),(120,'Madrasah Education','Madrasah Education',0,'2014-12-09 06:37:13','SYSTEM',NULL,NULL,1,1,1,20),(121,'Children Living Far from School','Children Living Far from School',0,'2014-12-09 06:31:06','SYSTEM',NULL,NULL,1,1,1,8),(122,'Street Children','Street Children',0,'2014-12-09 06:38:21','SYSTEM',NULL,NULL,1,1,1,27),(124,'Kinder ALS School Profile',NULL,0,'2018-02-22 09:12:39','SYSTEM',NULL,NULL,0,0,22,29),(125,'Total Enrolment in Kinder Summer Program','Total Enrolment in Kinder Summer Program',0,'2014-12-09 08:14:56','SYSTEM',NULL,NULL,1,123,22,30),(126,'Enrolment By Age in Kinder Summer Program','Enrolment By Age in Kinder Summer Program',0,'2014-12-09 08:15:34','SYSTEM',NULL,NULL,1,123,22,31),(127,'Total Enrolment in ALS','Total Enrolment in ALS',0,'2014-12-09 08:16:34','SYSTEM',NULL,NULL,1,123,22,32),(128,'Enrolment By Age in ALS','Enrolment By Age in ALS',0,'2014-12-09 08:17:04','SYSTEM',NULL,NULL,1,123,22,33),(1000,'Enrolment By Age','Enrolment By Age',1,'2014-12-09 06:43:47','SYSTEM',NULL,NULL,1,NULL,5,100),(1001,'Age School Profile',NULL,0,'2018-03-14 08:53:17','SYSTEM',NULL,NULL,1,0,5,101),(1002,'Total Enrolment By Age in Elementary Schools','Total Enrolment By Age in Elementary Schools',0,'2014-12-09 06:51:16','SYSTEM',NULL,NULL,1,1000,5,102),(1003,'Enrolment By Age in Elementary','Enrolment By Age in Elementary',0,'2014-12-09 07:05:33','SYSTEM',NULL,NULL,1,1000,5,103),(1004,'Enrolment By Age in Kindergarten','Enrolment By Age in Kindergarten',0,'2014-12-09 07:05:37','SYSTEM',NULL,NULL,1,1000,5,104),(1005,'Enrolment By Age in Grade 1','Enrolment By Age in Grade 1',0,'2014-12-09 07:07:24','SYSTEM',NULL,NULL,1,1000,5,105),(1006,'Enrolment By Age in Non-graded','Enrolment By Age in Non-graded',0,'2014-12-09 07:06:11','SYSTEM',NULL,NULL,1,1000,5,106),(1007,'Total Enrolment By Age in Secondary School